function Profile (props) {
    return (
        <>

            <p>
                <img src={props.image} alr="profile image" height={100} width ={100}></img><br/>
                My name is {props.name} and i am a {props.job} and formelry work as {props.past-job}. <br/>
                At the moment, i am currently studying these following tech stacks. <br/>
                <TechStack></TechStack>
            </p>        
        </>
    )
}
export default Profile
